1:8878:2745.docs:
Creates an iterator which uses a closure to determine if an element
should be yielded.

Given an element the closure must return `true` or `false`. The returned
iterator will yield only the elements for which the closure returns
true.

# Examples

Basic usage:

```
let a = [0i32, 1, 2];

let mut iter = a.iter().filter(|x| x.is_positive());

assert_eq!(iter.next(), Some(&1));
assert_eq!(iter.next(), Some(&2));
assert_eq!(iter.next(), None);
```

Because the closure passed to `filter()` takes a reference, and many
iterators iterate over references, this leads to a possibly confusing
situation, where the type of the closure is a double reference:

```
let a = [0, 1, 2];

let mut iter = a.iter().filter(|x| **x > 1); // need two *s!

assert_eq!(iter.next(), Some(&2));
assert_eq!(iter.next(), None);
```

It's common to instead use destructuring on the argument to strip away
one:

```
let a = [0, 1, 2];

let mut iter = a.iter().filter(|&x| *x > 1); // both & and *

assert_eq!(iter.next(), Some(&2));
assert_eq!(iter.next(), None);
```

or both:

```
let a = [0, 1, 2];

let mut iter = a.iter().filter(|&&x| x > 1); // two &s

assert_eq!(iter.next(), Some(&2));
assert_eq!(iter.next(), None);
```

of these layers.

Note that `iter.filter(f).next()` is equivalent to `iter.find(f)`.

1:3318:29131.docs:
Provides type based access to context intended for error reports.

Used in conjunction with [`Demand::provide_value`] and [`Demand::provide_ref`] to extract
references to member variables from `dyn Error` trait objects.

# Example

```rust
#![feature(provide_any)]
#![feature(error_generic_member_access)]
use core::fmt;
use core::any::Demand;

#[derive(Debug)]
struct MyBacktrace {
    // ...
}

impl MyBacktrace {
    fn new() -> MyBacktrace {
        // ...
        # MyBacktrace {}
    }
}

#[derive(Debug)]
struct SourceError {
    // ...
}

impl fmt::Display for SourceError {
    fn fmt(&self, f: &mut fmt::Formatter<'_>) -> fmt::Result {
        write!(f, "Example Source Error")
    }
}

impl std::error::Error for SourceError {}

#[derive(Debug)]
struct Error {
    source: SourceError,
    backtrace: MyBacktrace,
}

impl fmt::Display for Error {
    fn fmt(&self, f: &mut fmt::Formatter<'_>) -> fmt::Result {
        write!(f, "Example Error")
    }
}

impl std::error::Error for Error {
    fn provide<'a>(&'a self, demand: &mut Demand<'a>) {
        demand
            .provide_ref::<MyBacktrace>(&self.backtrace)
            .provide_ref::<dyn std::error::Error + 'static>(&self.source);
    }
}

fn main() {
    let backtrace = MyBacktrace::new();
    let source = SourceError {};
    let error = Error { source, backtrace };
    let dyn_error = &error as &dyn std::error::Error;
    let backtrace_ref = dyn_error.request_ref::<MyBacktrace>().unwrap();

    assert!(core::ptr::eq(&error.backtrace, backtrace_ref));
}
```

1:8906:2715.docs:
Transforms an iterator into a collection.

`collect()` can take anything iterable, and turn it into a relevant
collection. This is one of the more powerful methods in the standard
library, used in a variety of contexts.

The most basic pattern in which `collect()` is used is to turn one
collection into another. You take a collection, call [`iter`] on it,
do a bunch of transformations, and then `collect()` at the end.

`collect()` can also create instances of types that are not typical
collections. For example, a [`String`] can be built from [`char`]s,
and an iterator of [`Result<T, E>`][`Result`] items can be collected
into `Result<Collection<T>, E>`. See the examples below for more.

Because `collect()` is so general, it can cause problems with type
inference. As such, `collect()` is one of the few times you'll see
the syntax affectionately known as the 'turbofish': `::<>`. This
helps the inference algorithm understand specifically which collection
you're trying to collect into.

# Examples

Basic usage:

```
let a = [1, 2, 3];

let doubled: Vec<i32> = a.iter()
                         .map(|&x| x * 2)
                         .collect();

assert_eq!(vec![2, 4, 6], doubled);
```

Note that we needed the `: Vec<i32>` on the left-hand side. This is because
we could collect into, for example, a [`VecDeque<T>`] instead:

[`VecDeque<T>`]: ../../std/collections/struct.VecDeque.html

```
use std::collections::VecDeque;

let a = [1, 2, 3];

let doubled: VecDeque<i32> = a.iter().map(|&x| x * 2).collect();

assert_eq!(2, doubled[0]);
assert_eq!(4, doubled[1]);
assert_eq!(6, doubled[2]);
```

Using the 'turbofish' instead of annotating `doubled`:

```
let a = [1, 2, 3];

let doubled = a.iter().map(|x| x * 2).collect::<Vec<i32>>();

assert_eq!(vec![2, 4, 6], doubled);
```

Because `collect()` only cares about what you're collecting into, you can
still use a partial type hint, `_`, with the turbofish:

```
let a = [1, 2, 3];

let doubled = a.iter().map(|x| x * 2).collect::<Vec<_>>();

assert_eq!(vec![2, 4, 6], doubled);
```

Using `collect()` to make a [`String`]:

```
let chars = ['g', 'd', 'k', 'k', 'n'];

let hello: String = chars.iter()
    .map(|&x| x as u8)
    .map(|x| (x + 1) as char)
    .collect();

assert_eq!("hello", hello);
```

If you have a list of [`Result<T, E>`][`Result`]s, you can use `collect()` to
see if any of them failed:

```
let results = [Ok(1), Err("nope"), Ok(3), Err("bad")];

let result: Result<Vec<_>, &str> = results.iter().cloned().collect();

// gives us the first error
assert_eq!(Err("nope"), result);

let results = [Ok(1), Ok(3)];

let result: Result<Vec<_>, &str> = results.iter().cloned().collect();

// gives us the list of answers
assert_eq!(Ok(vec![1, 3]), result);
```

[`iter`]: Iterator::next
[`String`]: ../../std/string/struct.String.html
[`char`]: type@char

